Defendant in custody.    
Count 5 - Deliver Methamphetamine - Defendant is sentenced to the Wisconsin State Prison System for a total sentence of eight (8) years.   Three (3) years initial confinement, followed by five (5) years extended supervision imposed and stayed.   Defendant is placed on probation to DOC for five (5) years to commence upon the completion of her jail sentences.   Conditions of probation are:
1) Maintain absolute sobriety; 
2) Use only one pharmacist and only one doctor;
3) Submit to random urine screens and pay for same; 
4) Have no contact with any known drug users or dealers;
5) Pay restitution as follows: $50.00 buy money to Metro Drug; $450.00 to Bank First National; $398.99 to the Crossing; $4869 to Piggly Wiggly; $757.00 to Family Pantry; 
6) Have no contact with Timothy Yax, Joshua Reed, Danielle Koch, Sylvia Richmond, Fawn Endries, Jacob Nichols and Chris Bryan;
7) Pay costs of action;
8) Pay supervision fees in an amount to be determined by DOC;
9) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
10) Submit DNA sample and pay surcharge.  
Court finds the defendant is not eligible for the Challenge Incarceration Program, but is eligible for the Substance Abuse Program.   
